.
Trevie was trying to sunbake today, and noticed there isn‚Äôt much sun around at the moment. Living in Ballarat, he was a little worried about that he‚Äôs not getting enough sun, so he wanted to share his thoughts on Vitamin D
.
Vitamin D is a ‚Äòfat soluble‚Äô vitamin, which means that the body needs adequate fat intake in order to be able to absorb it. Unlike water soluble vitamins, the body doesn‚Äôt need fat soluble vitamins every day, as it‚Äôs able to store them
.
We don‚Äôt just get Vitamin D from sun though‚Ä¶ Salmon, eggs and mushrooms are a few of the other sources we can find it. So we don‚Äôt JUST need to go out sun baking to hit our required amounts
.
Most vitamins are needed to ensure we get the regular amount of growth and development
.
Vitamin D specifically aids the healthy development of bones and teeth by helping with the transportation and absorption of Phosphorus and Calcium in the body (it‚Äôs why Trev has such a nice smile!) 
.
TREV‚ÄôS SUMMARY
.
Do you NEED to supplement Vitamin D. Maybe‚Ä¶ During winter in a colder climate, yeah maybe, might be a good idea to ensure you get enough during winter
.
If you‚Äôre older and more sedentary, spending less time in the sun, probably. But in that case, lifestyle changes would be a better option rather than supplementing (as the case with most supplementation)
.
If you do CHOOSE to supplement with Vitamin D, look for a supplement with D3 (or Cholecalciferol), as it comes from animal sources and better used in the body, when compared to D2 (Ergocalciferol) which is less effective in circulating Vitamin D levels
.
